let icons = ["data:image/png;base64,", "data:image/png;base64,"]
let facts = ["Tunnel Networks: Kobolds live in sprawling tunnel networks. Cyberpunk kobolds augment these with networked sensor arrays and automated defense turrets, all controlled by a central AI 'Warren Mind'.", "Dragon Devotion: Traditional kobolds worship dragons. Cyberpunk kobolds see dragons as powerful data-lords, hoarding information (and sometimes physical hardware)  they try to curry favor by providing useful tech.", "Trap Masters: Known for their traps, cyberpunk kobolds use electrified grids, laser tripwires, and robotic spiders alongside traditional pits and snares.", "AI Spirits: Each Kobold warband will often have several 'spirit' units - small AI cores housed in scavenged drones or robotic shells that act as scouts, messengers, or even shock troops.", "Scale Colors & Clan: Kobold scale color signifies clan. In the cyberpunk age, this is displayed through LED patterns woven into their scales, showing allegiance and status.", "Scavenging Prowess: Kobolds are master scavengers. They can find usable components in almost any pile of junk, creating surprisingly effective cybernetic enhancements for themselves and their spirits.", "Weak but Numerous: Kobolds rely on being numerous to overcome larger foes. Cyberpunk kobolds compensate with swarms of micro-drones and coordinated attacks directed by their Warren Mind.", "Pack Tactics: Critical to kobold survival, pack tactics are amplified via networked comms between kobolds and their spirit units.", "Rune Tech: Traditional runes have been merged with circuit boards. These 'rune-circuits' provide low-level magical effects powered by salvaged energy cells.", "The Warren Mind: The central AI controlling a kobold warren isn't always sophisticated. Often it's built from cobbled-together parts, resulting in quirky personalities and unpredictable behavior."];

